                                                                                                                            },
                                                                                                                            {
                                                                                                                                "Variable": "$.languageCode",
                                                                                                                                "StringEquals": "pt"
                                                                                                                            }
                                                                                                                        ],
                                                                                                                        "Next": "DetectSyntaxTokens"
                                                                                                                    }
                                                                                                                ],
                                                                                                                "Default": "InvalidSupportedLanguagesForSyntax"
                                                                                                            },
                                                                                                            "InvalidSupportedLanguagesForSyntax": {
                                                                                                                "Type": "Pass",
                                                                                                                "End": true,
