                                                                                                                    "LanguageCode.$": "$.languageCode",
                                                                                                                    "Text.$": "$.text"
                                                                                                                },
                                                                                                                "Resource": "arn:aws:states:::aws-sdk:comprehend:detectSyntax",
                                                                                                                "Next": "ProcessDetectSyntaxTokens"
                                                                                                            },
