                                                                                                                    "ProcessorConfig": {
                                                                                                                        "Mode": "INLINE"
                                                                                                                    },
                                                                                                                    "StartAt": "ProcessDetectSyntaxToken",
                                                                                                                    "States": {
                                                                                                                        "ProcessDetectSyntaxToken": {
                                                                                                                            "Type": "Pass",
                                                                                                                            "End": true
                                                                                                                        }
                                                                                                                    }
                                                                                                                },
                                                                                                                "End": true,
                                                                                                                "ItemsPath": "$.SyntaxTokens",
